import React from "react";

function Intro() {
    return (
        <div>
            <h1>HI! WELCOME TO MY WEBSITE!</h1>
            <h3>I am Agustinus</h3>
            <p>I am an aspiring web developer and business consultant. I am currently working at a Japanese Company, managing the relationship between international subsidiaries and parent company.</p>
        </div>
    )
}

export default Intro;
